import React from "react";
import { Container, Row, Col } from "react-bootstrap";

const Footer = () => {
	return (
		<footer className="footer bg-primary">
			<Container>
				<Row>
					<Col className="text-center text-white py-3">
						Copyright &copy; confagro 2020
					</Col>
				</Row>
				<p className="justify left-align"></p>
				<div id="footer_nav_holder_outside">
					<div className="footer_nav_holder">
						<Row>
							<div className="col text-white"></div>
						</Row>
					</div>
				</div>
				<Row>
					<Col className="text-center text-gray py-3">confagro20@gmail.com</Col>
				</Row>
			</Container>
		</footer>
	);
};

export default Footer;
